import websiteLogo from './CookieDoughLogo.svg';

function Header(){
    return (
        <div className= 'header-bar'>
        <div className= 'div-right'>
        <img src= {websiteLogo} className= 'website-logo'></img>
        </div>
        <div className= 'div-left'>
        <a href='#'>Cart</a>
        <a href='#'>Profile</a>
        </div>
        </div>
    )
}

export default Header;
